    private static final String COLLIDING_VOTING_RECEIPT = "8a84806e40521c6d014052277a1e01dd,cf388078-7b7f-48ac-af11-0ef75474c606,,0de9bcd5-0fb7-4f3e-aeeb-e70113f7ad99,8092,Go7sr06qg/PQ6XD0zQh1RyeXHBP4AkWP5gRHwvyh+20=,000018,01,730071";
    private static final String BROKEN_ENCRYPTED_VOTE_LINE = "#";
    private NizkpRcgVcs nizkp;

    /**
     * Creates a NizkpRcgVcs object, loads the files with the voting receipts and encrypted votes, and runs the protocol.
     * @throws IOException Thrown if something goes wrong during IO.
     */
    @BeforeMethod
    public void createNizkpLoadDataFilesAndRun() throws IOException {
        nizkp = new NizkpRcgVcs(new String[] {
                    ENCRYPTED_VOTES_FILE_NAME, VOTING_RECEIPTS_FILE_NAME
                });
        nizkp.run();
    }

    /**
     * Verifies that the NIZKP produced an incident about the broken line
     * in the voting receipts file.
     */
    @Test
    public void resultsMustContainVotingReceiptBrokenLineIncident() {
        assertZkpContainsIncident(nizkp,
            new VotingReceiptBrokenLineIncident(BROKEN_VOTING_RECEIPT_LINE));
    }

    /**
     * Verifies that the NIZKP produced an incident about the broken line
     * in the encrypted votes file.
     */
    @Test
    public void resultsMustContainEncryptedVoteBrokenLineIncident() {
        assertZkpContainsIncident(nizkp,
            new EncryptedVoteBrokenLineIncident(BROKEN_ENCRYPTED_VOTE_LINE));
    }

    /**
     * Verifies that the NIZKP produced an incident about the double voting
     * receipt present in the test file.
     */
    @Test
    public void resultsMustContainDoubleOccurrenceOfVotingReceiptIncidentOfDoubleLine() {
        assertZkpContainsIncident(nizkp,
            new DoubleOccurrenceOfVotingReceiptIncident(
                new VotingReceipt(DOUBLE_VOTING_RECEIPT)));
    }

    /**
     * Verifies that the NIZKP did not produce an incident about the single voting
     * receipt present in the test file.
     */
    @Test
    public void resultsMustNotContainDoubleOccurrenceOfVotingReceiptIncidentOfSingleLine() {
        assertZkpDoesNotContainIncident(nizkp,
            new DoubleOccurrenceOfVotingReceiptIncident(
                new VotingReceipt(VOTING_RECEIPT)));
    }

    /**
    * Verifies that the NIZKP produced an incident about an encrypted vote
    * having a voting receipt that could not be found in the RCG list of
    * voting receipts.
    */
    @Test
    public void resultsMustContainEncryptedVoteWithoutVotingReceiptIncident() {
        assertZkpContainsIncident(nizkp,
            new EncryptedVoteWithoutVotingReceiptIncident(
                new EncryptedVote(ENCRYPTED_VOTE_MISSING_A_VOTING_RECEIPT)));
    }

    /**
    * Verifies that the NIZKP did not produce an incident about an encrypted vote
    * having a voting receipt that is present in the list of
    * voting receipts.
    */
    @Test
    public void resultsMustNotContainEncryptedVoteWithoutVotingReceiptIncidentForAMatch() {
        assertZkpDoesNotContainIncident(nizkp,
            new EncryptedVoteWithoutVotingReceiptIncident(
                new EncryptedVote(ENCRYPTED_VOTE)));
    }

    /**
     * Verifies that the NIZKP produced an incident for the voting receipt for
     * which there wasn't an encrypted vote with a voting receipt that matches.
     */
    @Test
    public void resultsMustContainVotingReceiptWithoutEncryptedVoteIncident() {
        assertZkpContainsIncident(nizkp,
            new VotingReceiptWithoutEncryptedVoteIncident(
                new VotingReceipt(VOTING_RECEIPT_MISSING_ENCRYPTED_VOTE)));
    }

    /**
     * Verifies that the NIZKP doesn't produce an incident for a voting receipt
     * that has been matched by an encrypted vote.
     */
    @Test
    public void resultsMustNotContainVotingReceiptWithoutEncryptedVoteIncidentForAMatch() {
        assertZkpDoesNotContainIncident(nizkp,
            new VotingReceiptWithoutEncryptedVoteIncident(
                new VotingReceipt(VOTING_RECEIPT)));
    }

    /**
     * Verifies that the NIZKP produces an incident about a voting receipt
     * collision for the two encrypted votes having matching voting receipts.
     */
    @Test
    public void resultsMustContainVotingReceiptCollisionIncident() {
        assertZkpContainsIncident(nizkp,
            new VotingReceiptCollisionIncident(
                new VotingReceipt(COLLIDING_VOTING_RECEIPT),
                new EncryptedVote(FIRST_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION),
                new EncryptedVote(SECOND_ENCRYPTED_VOTE_FOR_RECEIPT_COLLISION)));
    }
